function listRevisions(revisions) {
    var numberOfRevisions = revisions.length;
    for (index = 0; index < numberOfRevisions; index++){
        revisions[index].toString = function(){
            return (new Date(this.Timestamp).format("dd.mm.yyyy HH:MM"));
        };
    }
    this.updateList(revisions.reverse());
}

