function loadWorldHistory() {
    var result = [];
    for (var key in localStorage){
        if (key.substring(0, 18) == "LimeMachineHistory"){
           result.push(key.substr(19));
        }
    }
    this.worldList.updateList(result);
    this.worldList.clearSelection();
}

