function displayMethodsOfObject(selectedObject) {
    if (selectedObject == undefined){
        return;    
    }
    var methods = selectedObject.Code.groupBy( function(item) {
        return item.MethodName;} );
    this.methodList.listMethods(methods);
    this.methodList.clearSelection();
}

